import React from "react";

import Item from "../utils/Item";

import '../styles/Content.css';

interface State {
	feeds: string
}

class Content extends React.Component {
	state: State

	constructor(props: any) {
		super(props);

		this.state = {
			feeds: ""
		};
	}

	componentDidMount(): any {

	}

	render(): any {
		return(
			<div className="Content">
				{this.state.feeds}
			</div>
		);
	}
}

export default Content;
